import styled from 'styled-components';

const Deposit = () => {
  return (
    <DepositWrapper>
      <Heading as="h2" size="lg">
        exchange
      </Heading>
      <p>This is a Gatsby starter blog with TypeScript and styled-components.</p>
    </DepositWrapper>
  );
};

const DepositWrapper = styled.div`
  max-width: 960px;
  margin: 0 auto;
  padding: 0 1rem;
`;

export default Deposit;
